import React, { useState } from 'react';
import axios from 'axios';
import logo from './logo.svg';
import './App.css';

function App() {

  const [formData, setFormData] = useState({
    url: '',
    firstName: '', lastName: '',
    sourceFind: '', prevEmployed: '',
    countryFrom: '',
    addy1: '', addy2: '',
    addressCity: '', addressState: '',
    addressPostalCode: '', addressCounty: '',
    emailFunction: '',
    countryPhoneCode: '',
    phoneNumber: '', phoneDeviceType: '',

  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3001/submit-workday', formData);
      alert('Starting to fill application');
    } catch (error) {
      console.error('Error:', error);
      alert('An error occurred. Please try again.');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to E-day, Were here to simplify Workday Job Applications
        </p>
        <h1>Submit Form</h1>
      <form onSubmit={handleSubmit}>
      <label>
          URL:
          <input
            type="text"
            name="url"
            value={formData.url}
            onChange={handleChange}
          />
        </label>
        <br />
      <label>
          Job Source:
          <input
            type="text"
            name="sourceFind"
            value={formData.sourceFind}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Previously employed:
          <input
            type="text"
            name="prevEmployed"
            value={formData.prevEmployed}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Country:
          <input
            type="text"
            name="countryFrom"
            value={formData.countryFrom}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          First Name:
          <input
            type="text"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Last Name:
          <input
            type="text"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Adress 1:
          <input
            type="text"
            name="addy1"
            value={formData.addy1}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Adress 2:
          <input
            type="text"
            name="addy2"
            value={formData.addy2}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          City:
          <input
            type="text"
            name="addressCity"
            value={formData.addressCity}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          State:
          <input
            type="text"
            name="addressState"
            value={formData.addressState}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Zip Code:
          <input
            type="text"
            name="addressPostalCode"
            value={formData.addressPostalCode}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          County:
          <input
            type="text"
            name="addressCounty"
            value={formData.addressCounty}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Email:
          <input
            type="text"
            name="emailFunction"
            value={formData.emailFunction}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Country Phone Code:
          <input
            type="text"
            name="countryPhoneCode"
            value={formData.countryPhoneCode}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Phone Number:
          <input
            type="text"
            name="phoneNumber"
            value={formData.phoneNumber}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Phone Device Type:
          <input
            type="text"
            name="phoneDeviceType"
            value={formData.phoneDeviceType}
            onChange={handleChange}
          />
        </label>
        <br />
        {/* Add other form fields here */}
        <br />
        <button type="submit">Submit</button>
      </form>
      </header>
    </div>
  );
}

export default App;
